import React from 'react';
import { Button, TextField, Switch, label } from '@mui/material';

export default function form() {
    return (

        <form>

            <TextField label="Name" margin="normal" fullWidth />


            <TextField label="Sobrenome" margin="normal" fullWidth />

            <TextField label="CPF" margin="normal" fullWidth />



            <label>Promocoes:
                <input type="checkbox" />
            </label>

            <label>Novidades:
                <input type="checkbox" />
            </label>

            <Switch {...label} />
            <Switch {...label} />

            <Button type="submit" variant="contained">Cadastrar</Button>
        </form>

    )
}
